import React from 'react'
import './About.css'
import { Row, Col, Container } from 'reactstrap'
import logo  from '../res/mainelements/logo_white_text.png';
import tv  from '../res/saaranglogo/television.svg';
import cam from '../res/saaranglogo/camera.svg';

class AboutComponent extends React.Component {
  render() {
    return <div className="cont" >
      <div style="width:100%;height:0;padding-bottom:100%;position:relative;"><iframe src="https://giphy.com/embed/y30LCMuHRVbxK" width="100%" height="100%" style={{position:"absolute"}} frameBorder="0" className="giphy-embed" allowFullScreen></iframe></div><p><a href="https://giphy.com/gifs/purple-swirl-arcoiris-y30LCMuHRVbxK">via GIPHY</a></p>
      <img id="img1" src= {cam} height= "15%" width = "15%"  />
      <img id="img3" src= { logo } height = '40%' width = '40%' />
      <img id="img2" src= {tv} height= "15%" width = "15%"  />

    </div>
  }
}

export default AboutComponent
